import { useProduct } from './Context'

export default function Sample() {
    const {cart} = useProduct()
    console.log(cart)
  return (
    <div className='row'>
        {
            cart.map(value=>{
                return(
                    <div>
                        <img src={value.image}></img>
                    </div>
                )
            })
        }
    </div>
  )
}
